INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100081, 'eng', 'Collection', 'A collection is an aggregation of items. The term collection means that the resource is described as a group; its parts may be separately described and navigated.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100082, 'eng', 'Dataset', 'A dataset is information encoded in a defined structure (for example, lists, tables, and databases), intended to be useful for direct machine processing.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100083, 'eng', 'Event', 'An event is a non-persistent, time-based occurrence. Metadata for an event provides descriptive information that is the basis for discovery of the purpose, location, duration, responsible agents, and links to related events and resources. The resource of type event may not be retrievable if the described instantiation has expired or is yet to occur. Examples - exhibition, web-cast, conference, workshop, open-day, performance, battle, trial, wedding, tea-party, conflagration.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100084, 'eng', 'Image', 'An image is a primarily symbolic visual representation other than text. For example - images and photographs of physical objects, paintings, prints, drawings, other images and graphics, animations and moving pictures, film, diagrams, maps, musical notation. Note that image may include both electronic and physical representations.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100085, 'eng', 'Interactive Resource', 'An interactive resource is a resource which requires interaction from the user to be understood, executed, or experienced. For example - forms on web pages, applets, multimedia learning objects, chat services, virtual reality.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100086, 'eng', 'Moving Image', 'A series of visual representations that, when shown in succession, impart an impression of motion. Examples of moving images are: animations, movies, television programs, videos, zoetropes, or visual output from a simulation.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100087, 'eng', 'Physical Object', 'An inanimate, three-dimensional object or substance. For example -- a computer, the great pyramid, a sculpture. Note that digital representations of, or surrogates for, these things should use Image, Text or one of the other types.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100088, 'eng', 'Service', 'A service is a system that provides one or more functions of value to the end-user. Examples include: a photocopying service, a banking service, an authentication service, interlibrary loans, a Z39.50 or Web server.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100089, 'eng', 'Software', 'Software is a computer program in source or compiled form which may be available for installation non-transiently on another machine. For software which exists only to create an interactive environment, use interactive instead.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100090, 'eng', 'Sound', 'A sound is a resource whose content is primarily intended to be rendered as audio. For example - a music playback file format, an audio compact disc, and recorded speech or sounds.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100091, 'eng', 'Still Image', 'A static visual representation. Examples of still images are: paintings, drawings, graphic designs, plans and maps.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 480, 'eng', 'Browse Graphic', 'graphic that provides an illustration of the dataset (should include a legend for the graphic)');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 3850, 'eng', 'country', 'country of the physical address');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100092, 'eng', 'Text', 'A text is a resource whose content is primarily words for reading. For example - books, letters, dissertations, poems, newspapers, articles, archives of mailing lists. Note that facsimiles or images of texts are still of the genre text.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100093, 'eng', 'Project *', 'Added by HSRS');
