INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10001, 'eng', 'title', 'A name given to the resource. Typically, Title will be a name by which the resource is formally known.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10002, 'eng', 'creator', 'An entity primarily responsible for making the content of the resource. Examples of Creator include a person, an organization, or a service. Typically, the name of a Creator should be used to indicate the entity.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10003, 'eng', 'subject', 'A topic of the content of the resource. Typically, Subject will be expressed as keywords, key phrases or classification codes that describe a topic of the resource. Recommended best practice is to select a value from a controlled vocabulary or formal classification scheme.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10004, 'eng', 'description', 'An account of the content of the resource. Examples of Description include, but is not limited to: an abstract, table of contents, reference to a graphical representation of content or a free-text account of the content.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10005, 'eng', 'publisher', 'An entity responsible for making the resource available. Examples of Publisher include a person, an organization, or a service. Typically, the name of a Publisher should be used to indicate the entity.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10006, 'eng', 'contributor', 'An entity responsible for making contributions to the content of the resource. Examples of Contributor include a person, an organization, or a service. Typically, the name of a Contributor should be used to indicate the entity.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10007, 'eng', 'Date', 'A date of an event in the lifecycle of the resource. Typically, Date will be associated with the creation or availability of the resource. Recommended best practice for encoding the date value is defined in a profile of ISO 8601 [W3CDTF] and includes (among others) dates of the form YYYY-MM-DD.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10008, 'eng', 'type', 'The nature or genre of the content of the resource. Type includes terms describing general categories, functions, genres, or aggregation levels for content. Recommended best practice is to select a value from a controlled vocabulary (for example, the DCMI Type Vocabulary [DCT1]). To describe the physical or digital manifestation of the resource, use the FORMAT element.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('PN', 4, 'eng', 'ISO 19115 INSPIRE', NULL);
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('PN', 7, 'eng', 'Micka', NULL);
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10009, 'eng', 'format', 'The physical or digital manifestation of the resource. Typically, Format may include the media-type or dimensions of the resource. Format may be used to identify the software, hardware, or other equipment needed to display or operate the resource. Examples of dimensions include size and duration. Recommended best practice is to select a value from a controlled vocabulary (for example, the list of Internet Media Types [MIME] defining computer media formats).');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10010, 'eng', 'identifier', 'An unambiguous reference to the resource within a given context. Recommended best practice is to identify the resource by means of a string or number conforming to a formal identification system. Formal identification systems include but are not limited to the Uniform Resource Identifier (URI) (including the Uniform Resource Locator (URL)), the Digital Object Identifier (DOI) and the International Standard Book Number (ISBN).');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10011, 'eng', 'source', 'A Reference to a resource from which the present resource is derived. The present resource may be derived from the Source resource in whole or in part. Recommended best practice is to identify the referenced resource by means of a string or number conforming to a formal identification system.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10012, 'eng', 'language', 'A language of the intellectual content of the resource. Recommended best practice is to use RFC 3066 [RFC3066] which, in conjunction with ISO639 [ISO639]), defines two- and three-letter primary language tags with optional subtags. Examples include "en" or "eng" for English, "akk" for Akkadian", and "en-GB" for English used in the United Kingdom.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10013, 'eng', 'relation', 'A reference to a related resource. Recommended best practice is to identify the referenced resource by means of a string or number conforming to a formal identification system.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10014, 'eng', 'coverage', 'The extent or scope of the content of the resource. Typically, Coverage will include spatial location (a place name or geographic coordinates), temporal period (a period label, date, or date range) or jurisdiction (such as a named administrative entity). Recommended best practice is to select a value from a controlled vocabulary (for example, the Thesaurus of Geographic Names [TGN]) and to use, where appropriate, named places or time periods in preference to numeric identifiers such as sets of coordinates or date ranges.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10015, 'eng', 'rights', 'Information about rights held in and over the resource. Typically, Rights will contain a rights management statement for the resource, or reference a service providing such information. Rights information often encompasses Intellectual Property Rights (IPR), Copyright, and various Property Rights. If the Rights element is absent, no assumptions may be made about any rights held in or over the resource.');
